import './App.css';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";
import Navbar from './component/Navbar';
import {Shop} from "../src/pages/shop/Shop";
import {Cart} from "../src/pages/cart/Cart";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Routes>
          <Route path='/'/>
          <Route path='/cart' />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
